pragma solidity >=0.4.0 <0.7.0;

library Utils {event __CoverageUtils(string fileName, uint256 lineNumber);
event __FunctionCoverageUtils(string fileName, uint256 fnId);
event __StatementCoverageUtils(string fileName, uint256 statementId);
event __BranchCoverageUtils(string fileName, uint256 branchId, uint256 locationIdx);
event __AssertPreCoverageUtils(string fileName, uint256 branchId);
event __AssertPostCoverageUtils(string fileName, uint256 branchId);

    function getPostObject(
        uint key,
        string memory name,
        string memory description
    ) internal      returns(string memory content) {emit __FunctionCoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',1);

emit __CoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',9);
        emit __StatementCoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',1);
content = string(abi.encodePacked(
            '{"key": ', '"', toString(key), '"',
            ', "name": ', '"', name, '"',
            ', "description": ', '"', description, '"',
            '}')
        );
    }
    function toString(uint _i) internal      returns (string memory _uintAsString) {emit __FunctionCoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',2);

emit __CoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',17);
        emit __StatementCoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',2);
uint j = _i;
emit __CoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',18);
        emit __StatementCoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',3);
uint len;
emit __CoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',19);
        emit __StatementCoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',4);
while (j != 0) {
emit __CoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',20);
            len++;
emit __CoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',21);
            emit __StatementCoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',5);
j /= 10;
        }
emit __CoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',23);
        emit __StatementCoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',6);
bytes memory bstr = new bytes(len);
emit __CoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',24);
        emit __StatementCoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',7);
uint k = len - 1;
emit __CoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',25);
        emit __StatementCoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',8);
j = _i;

emit __CoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',27);
        emit __StatementCoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',9);
while (j != 0) {
emit __CoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',28);
            emit __StatementCoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',10);
bstr[k--] = byte(uint8(48 + j % 10));
emit __CoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',29);
            emit __StatementCoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',11);
j /= 10;
        }
emit __CoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',31);
        emit __StatementCoverageUtils('/home/pkro/Kingsland/projects/dapp/contracts/Utils.sol',12);
return string(bstr);
    }
}
